/*!40000 ALTER TABLE `courses` DISABLE KEYS */;
INSERT INTO `courses` VALUES (1,'Return to Meditation',3,'2016-07-10','Sometimes the seriousness of life wears down our spiritual side and we lose our way. With guided meditation, discourses and discussions, this mini retreat is designed to help usher your mind back to a place of awareness and control.',22,20,1,1,1,1,10),(2,'Foundations of Meditation and Mindfulness',10,'2016-07-20','Make the journey within and learn how to discover the \'real self\'. Train your mind to be at ease and cultivate peaceful and compassionate feelings and thoughts. With guided meditation, teachings and discussions, this course will serve as both a great introduction to meditation for new students and a thorough refresher for experienced students.',22,19,1,1,1,1,10),(3,'Meditation and Movement',10,'2016-08-06','Sometimes it isn\'t easy to sit still and meditate while always maintaining focus, especially for beginners. Instead, it can be ideal to alternate between sitting meditation, such as yoga asana, and \"moving meditation\" techniques. Students of this course will be guided on how to meditate while moving their body and will gain an awareness of both their body and the physical world of nature itself. Journey with us on the path to true self-control.',25,16,1,1,1,1,10),(4,'Intuitive Mellowing',3,'2016-08-23','You are invited to heal from your past and dislodge negative experiences and stress from your mind with guidance from expert instructors and meditation techniques passed down for generations. Many meditation sessions in this course will involve yoga asana and exercises to enhance body functions and release tension.',23,25,1,1,1,1,10),(5,'Vipassana',10,'2016-09-04','\"To see things as they really are\", that is what is meant by Vipassana. This is one of the most ancient techniques of meditation but is appropriate for anyone, regardless of experience, seeking spiritual growth and an understanding of how to free oneself from suffering. Through teachings, discourses and guided meditation, students will begin a journey involving observation and self-exploration to find the path to non-delusion, self-control and peace.',24,25,1,1,1,1,10),(6,'Comprehensive Meditation Guide',30,'2016-09-21','This 30-day retreat features a wide variety of lesson types, teaching many different meditation techniques in a single course. No other course offers such a broad range of meditation techniques, and some of the more unusual or unconventional meditation techniques will only be taught in this course. Students still inexperienced in meditation will especially benefit from this course, as they are likely to discover the meditation styles that work best for them.',25,25,1,1,1,1,10),(7,'Breathe',3,'2016-10-27','With the help of mind-blowing, inspirational instructions, this course refreshes students on some basic meditation techniques and focuses on breath meditation. If you don\'t breathe you can\'t stay alive.',25,23,1,1,1,1,10),(8,'Freedom of the Mind',30,'2016-11-07','Experienced students will learn to deepen their meditation practices as they focus on realizing the empty nature of \"I\" and \"self\". This course includes dharma talks, silent practice and meditation instructions emphasising deep inquiry.',25,25,1,1,1,1,10),(9,'Return to Meditation',3,'2016-12-13','Sometimes the seriousness of life wears down our spiritual side and we lose our way. With guided meditation, discourses and discussions, this mini retreat is designed to help usher your mind back to a place of awareness and control.',25,25,1,1,1,1,10),(10,'Foundations of Meditation and Mindfulness',10,'2016-12-23','Take a journey within and learn how to discover the \'real self\'. Train your mind to be at ease and cultivate peaceful and compassionate feelings and thoughts. With guided meditation, teachings and discussions, this course will serve as both a great introduction to meditation for new students and a thorough refresher for experienced students.',23,21,1,1,1,1,8),(11,'Intuitive Mellowing',3,'2017-01-10','You are invited to heal from your past and dislodge negative experiences and stress from your mind with guidance from expert instructors and meditation techniques passed down for generations. Many meditation sessions in this course will involve yoga asana and exercises to enhance body functions and release tension.',0,0,0,0,0,0,0),(12,'Meditation and Movement',10,'2017-01-20','Sometimes it isn\'t easy to sit still and meditate while always maintaining focus, especially for beginners. Instead, it can be ideal to alternate between sitting meditation, such as yoga asana, and \"moving meditation\" techniques. Students of this course will be guided on how to meditate while moving their body and will gain an awareness of both their body and the physical world of nature itself. Journey with us on the path to true self-control.',0,0,0,0,0,0,0),(13,'Vipassana and the Path to Enlightenment',30,'2017-02-06','This course is for the most dedicated of students seeking to truly view reality as it is. This course will help your mind become still as you learn to see beyond both worldly desires and pain. This course is a serious undertaking for experienced students only, and students will not talk or write or look directly at others for the duration of the course. Daily discourses, individual meditation and instructional guidance will help students to view themselves and the world without bias.',0,0,0,0,0,0,0),(14,'Return to Meditation',3,'2017-03-12','Sometimes the seriousness of life wears down our spiritual side and we lose our way. With guided meditation, discourses and discussions, this mini retreat is designed to help usher your mind back to a place of awareness and control.',0,0,0,0,0,0,0),(15,'Foundations of Meditation and Mindfulness',10,'2017-03-22','Take a journey within and learn how to discover the \'real self\'. Train your mind to be at ease and cultivate peaceful and compassionate feelings and thoughts. With guided meditation, teachings and discussions, this course will serve as both a great introduction to meditation for new students and a thorough refresher for experienced students.',0,0,0,0,0,0,0),(16,'Breathe',3,'2017-04-06','With the help of mind-blowing, inspirational instructions, this course refreshes students on some basic meditation techniques and focuses on breath meditation. If you don\'t breathe you can\'t stay alive.',0,0,0,0,0,0,0),(17,'Comprehensive Meditation Guide',30,'2017-04-16','This 30-day retreat features a wide variety of lesson types, teaching many different meditation techniques in a single course. No other course offers such a broad range of meditation techniques, and some of the more unusual or unconventional meditation techniques will only be taught in this course. Students still inexperienced in meditation will especially benefit from this course, as they are likely to discover the meditation styles that work best for them.',3,3,0,0,0,0,0),(18,'Intuitive Mellowing',3,'2017-05-22','You are invited to heal from your past and dislodge negative experiences and stress from your mind with guidance from expert instructors and meditation techniques passed down for generations. Many meditation sessions in this course will involve yoga asana and exercises to enhance body functions and release tension.',0,0,0,0,0,0,0),(19,'Vipassana',10,'2017-06-02','\"To see things as they really are\", that is what is meant by Vipassana. This is one of the most ancient techniques of meditation but is appropriate for anyone, regardless of experience, seeking spiritual growth and an understanding of how to free oneself from suffering. Through teachings, discourses and guided meditation, students will begin a journey involving observation and self-exploration to find the path to non-delusion, self-control and peace.',0,0,0,0,0,0,0);
